import React, { Component } from "react";
import { Button } from "reactstrap";
import "../styles/Article.css";
import Navbar from "./Navbar.js";
import Footer from "./Footer.js";
import axios from "axios";
import Card from "./Card";
import Sak from "./Sak";
import {
  Container,
  ButtonDropdown,
  DropdownMenu,
  DropdownItem,
  DropdownToggle
} from "reactstrap";
import { createHashHistory } from "history";

// Use history.push(...) to programmatically change path, for instance after successfully editing an article
const history = createHashHistory();

export default class ArticleEdit extends Component<{
  articleId?: number
}> {
  deleteHandler = e => {
    e.preventDefault();
    if (window.confirm("Er du sikker?")) {
      axios
        .delete("http://localhost:8000/sak/" + this.props.articleId)
        .then(response => {
          console.log(response);
        })
        .catch(error => {
          console.log(error);
        });
      alert("Saken er slettet");
      history.push("");
    }
  };

  render() {
    return (
      <div>
        <Button className="bg-danger fa fa-delete" onClick={this.deleteHandler}>
          Slett sak
        </Button>
      </div>
    );
  }
}
